INSERT INTO `aurav2_workflow_stages` (`id`, `name`, `description`, `icon`, `stage_order`, `workflow_type`, `definition_of_ready`, `key_players`, `definition_of_done`, `activities`, `reference_documents`, `ai_consolidation_enabled`, `created_at`, `updated_at`) VALUES ('idea','Capture Idea as Business Brief','Outlines a new business idea and facilitating effective decision-making','lightbulb',1,'both','[\"Idea to be pursued identified\", \"Business features or tech enablers defined\", \"Business Sponsor identified\"]','[{\"role\": \"business_owner\", \"name\": \"Business Owner (BO)\"}, {\"role\": \"business_sponsor\", \"name\": \"Business Sponsor\"}, {\"role\": \"portfolio_leadership\", \"name\": \"Portfolio Leadership\"}]','[\"Idea captured as Business Brief\", \"High level impact analysis completed\", \"Ready to be Qualified\"]','[{\"owner\": \"BO\", \"activity\": \"Raise and submit the Idea via the Idea Management tool\"}, {\"owner\": \"BO\", \"activity\": \"Present the idea to stakeholders\"}, {\"owner\": \"MPD\", \"activity\": \"Perform internal business review and Impact analysis\"}]','[\"Idea Management App\", \"Idea Management Workflow\", \"Small Enhancement Guidelines\"]',1,'2025-08-17 06:06:10','2025-08-17 06:06:10'),
('prioritize','Prioritise the Initiative','Initiative prioritised by business & IT to pull from Portfolio funnel','list-ordered',3,'both','[\"Idea qualified as Initiative\", \"Initiative added to Portfolio funnel\", \"Latest updated view of Portfolio roadmap\"]','[{\"role\": \"business_owner\", \"name\": \"Business Owner (BO)\"}, {\"role\": \"vp_portfolio\", \"name\": \"VP Portfolio\"}, {\"role\": \"portfolio_leadership\", \"name\": \"Portfolio Leadership\"}]','[\"Initiative prioritized and PPM updated\", \"Stakeholders aligned\", \"Build/buy decision revalidated\"]','[{\"owner\": \"MPD\", \"activity\": \"Review and prioritise initiative and capture in PPM portfolio\"}, {\"owner\": \"MPD\", \"activity\": \"Update and present Roadmap to stakeholders\"}, {\"owner\": \"VP\", \"activity\": \"Manage capacity and priority conflicts\"}, {\"owner\": \"MEA\", \"activity\": \"Provide inputs on technical complexity and NFR requirements\"}]','[\"PPM Tool\", \"Non-functional requirements\"]',1,'2025-08-17 06:06:10','2025-08-17 06:06:10'),
('qualify','Qualify the Idea','Research, filter and assess new business ideas against available products','search',2,'both','[\"Business brief captured\", \"Idea impact assessment completed\"]','[{\"role\": \"business_owner\", \"name\": \"Business Owner (BO)\"}, {\"role\": \"portfolio_leadership\", \"name\": \"Portfolio Leadership\"}, {\"role\": \"art_leadership\", \"name\": \"ART Leadership\"}, {\"role\": \"pmo\", \"name\": \"PMO\"}]','[\"Idea qualification complete\", \"Owning ART identified\", \"Build/buy decision preliminary\", \"Business brief qualified\"]','[{\"owner\": \"MPD\", \"activity\": \"Manage the Idea Backlog and lifecycle\"}, {\"owner\": \"BO\", \"activity\": \"Present the business brief to IT stakeholders\"}, {\"owner\": \"MPD\", \"activity\": \"Evaluate and prioritise ideas with required players\"}, {\"owner\": \"MEA\", \"activity\": \"Review feasibility with Business Platform teams\"}]','[\"Idea Management App\", \"Generic Service Level Agreement\", \"Small Enhancement Guidelines\"]',1,'2025-08-17 06:06:10','2025-08-17 06:06:10');
INSERT INTO `business_briefs` (`id`, `title`, `description`, `business_owner`, `lead_business_unit`, `additional_business_units`, `primary_strategic_theme`, `business_objective`, `quantifiable_business_outcomes`, `in_scope`, `out_of_scope`, `impact_of_do_nothing`, `happy_path`, `exceptions`, `impacted_end_users`, `change_impact_expected`, `impact_to_other_departments`, `other_departments_impacted`, `impacts_existing_technology`, `technology_solutions`, `relevant_business_owners`, `other_technology_info`, `supporting_documents`, `submitted_by`, `submitted_at`, `status`, `priority`, `workflow_stage`, `completion_percentage`, `created_at`, `updated_at`) VALUES ('BB-001','Customer Portal Enhancement','Enhance the customer portal with self-service capabilities','joshua-payne','technology','[\"operations\",\"customer-service\"]','customer-experience','Modernize customer interactions by providing comprehensive self-service capabilities that reduce operational overhead while enhancing customer satisfaction and engagement.','Reduce customer service calls by 40%, improve customer satisfaction scores by 30%, and decrease response time to customer inquiries from 24 hours to 2 hours.','Customer account management, order tracking, billing inquiries, support ticket creation',NULL,'Continued high support costs, declining customer satisfaction, competitive disadvantage','Customer logs in, views account status, tracks orders, resolves billing questions without calling support','Complex billing issues, refund requests, technical support needs','External customers, internal customer service representatives, billing team members','Customers will need to adapt to new self-service processes. Training materials and gradual rollout required.','Customer Service: Reduced call volume, need for process updates. Finance: New billing inquiry automation. IT: Infrastructure and security updates required.','[\"Customer Service\",\"Finance\",\"IT Security\"]','yes','Current customer portal (legacy ASP.NET), CRM system (Salesforce), billing system (SAP)','Customer Service Director, Finance Manager, IT Director','Integration with existing SSO, compliance with GDPR requirements','[\"customer_survey_results.pdf\",\"competitor_analysis.docx\",\"technical_architecture.pptx\"]','Joshua Payne','2024-01-15 00:00:00','approved','high','execution',75,'2025-08-20 09:35:44','2025-08-26 06:16:17'),
('BB-002','Mobile Payment Integration','Integrate mobile payment solutions into the existing e-commerce platform','jane-smith','marketing','[]','digital-transformation','Reduce cart abandonment and increase mobile sales by implementing modern payment solutions that meet customer expectations.','Increase mobile conversion rate by 30%, reduce cart abandonment by 20%, achieve 15% growth in mobile sales revenue.','',NULL,'','','','Mobile app users, e-commerce customers, payment processing team','Customers will have new payment options. Marketing team needs to promote new features.','','[]','yes','Current payment gateway (Stripe), mobile app (React Native), fraud detection system','','','[]','Jane Smith','2024-01-20 00:00:00','in_review','medium','discovery',35,'2025-08-20 09:35:44','2025-08-20 09:35:44'),
('BB-003','AI-Powered Inventory Optimization','Implement machine learning for predictive inventory management','mike-johnson','operations','[]','operational-efficiency','Optimize inventory levels using AI to reduce carrying costs while preventing stockouts and improving supply chain efficiency.','Reduce inventory carrying costs by 18%, decrease stockouts by 35%, improve inventory turnover ratio by 25%.','',NULL,'','','','Warehouse staff, procurement team, supply chain managers, finance team','','','[]','no','','','','[]','Mike Johnson','2024-01-25 00:00:00','draft','high','idea',10,'2025-08-20 09:35:44','2025-08-20 09:35:44'),
('BB-004','Emirates Booking Management System Enhancement','Enhance the Emirates booking management system with improved user experience and streamlined booking operations','sarah-abdullah','customer-operations','[\"technology\",\"customer-service\"]','customer-experience','Modernize the Emirates booking management experience by providing customers with intuitive, self-service capabilities for managing their flight bookings, reducing operational overhead while enhancing customer satisfaction.','Reduce customer service calls related to booking management by 45%, improve booking modification completion rate by 35%, and decrease average booking management time from 15 minutes to 5 minutes.','Booking management interface, flight modification capabilities, booking status tracking, customer notification system',NULL,'Continued high customer service load, poor customer experience, competitive disadvantage in digital services','Customer navigates to Emirates.com, clicks on \'Manage Bookings\', enters booking reference, views booking details, makes modifications, and receives confirmation','Complex booking changes requiring agent assistance, group bookings, special service requests','Emirates customers, customer service representatives, booking operations team','Customers will have enhanced self-service capabilities. Staff training required for new system features and processes.','Customer Service: Reduced booking-related calls. Operations: Updated booking management processes. IT: Infrastructure updates and security enhancements required.','[\"Customer Service\",\"Flight Operations\",\"IT Security\",\"Revenue Management\"]','yes','Current Emirates booking system, customer portal (React), reservation system (Amadeus), notification service','Customer Experience Director, Operations Manager, IT Director','Integration with Amadeus GDS, compliance with airline industry standards, GDPR compliance for customer data','[\"customer_feedback_analysis.pdf\",\"booking_system_requirements.docx\",\"technical_integration_specs.pptx\"]','Sarah Abdullah','2024-02-01 00:00:00','approved','high','execution',80,'2025-08-20 09:35:44','2025-08-20 09:35:44');
