('init-004','BB-004','Emirates Booking Management Enhancement Initiative','Modernize the Emirates booking management system to provide customers with seamless self-service capabilities for managing their flight bookings','Reduce customer service calls by 45%, improve booking modification completion rate by 35%, and enhance Emirates brand reputation for digital excellence','[\"Manage Bookings interface is fully functional and intuitive\",\"Booking modifications can be completed without agent assistance\",\"System integrates seamlessly with existing Emirates reservation system\",\"Mobile-responsive design works across all devices\",\"Customer satisfaction scores improve by 35%\"]','high','in_progress',NULL,NULL,'execution',60,'2025-08-20 09:35:44','2025-08-25 20:38:07','PORTFOLIO-WEB-MOBILE'),
('INIT-mftijn4n-ipve','BB-001','Comprehensive Self-Service Platform Development','Develop a robust self-service platform enabling customers to independently resolve issues and access services, reducing reliance on direct customer support.','Enhances operational efficiency, reduces costs, and improves customer engagement.','[\"Platform reduces customer service calls by at least 40%\",\"Achieves a 30% increase in customer satisfaction scores\"]','high','planning','Unassigned',NULL,'planning',0,'2025-09-21 09:46:53','2025-09-21 09:46:53',NULL),
('INIT-mftijn51-r795','BB-001','Real-Time Customer Support Integration','Implement real-time customer support solutions such as chatbots and live chat to provide immediate assistance and reduce response times.','Significantly enhances customer service efficiency and satisfaction.','[\"Response times reduced from 24 hours to 2 hours\",\"Real-time support adoption by at least 70% of customer interactions\"]','high','planning','Unassigned',NULL,'planning',0,'2025-09-21 09:46:53','2025-09-21 09:46:53',NULL),
('INIT-mftijn53-22ic','BB-001','User Interface and Experience Overhaul','Redesign the customer portal interface to improve usability and accessibility, catering to diverse customer needs and enhancing user satisfaction.','Increases user engagement and satisfaction, reducing operational overhead.','[\"Improved customer satisfaction scores by 30%\",\"Positive feedback from at least 80% of portal users post-redesign\"]','medium','planning','Unassigned',NULL,'planning',0,'2025-09-21 09:46:53','2025-09-21 09:46:53',NULL),
('INIT-mftiqu0u-zk1a','BB-001','Comprehensive Self-Service Portal Development','Develop a comprehensive self-service portal to modernize customer interactions and reduce dependency on traditional customer service channels.','Significantly reduces operational overhead and improves customer satisfaction by providing more efficient service delivery.','[\"Launch a fully functional self-service portal within 12 months.\",\"Achieve a 40% reduction in customer service calls within the first year.\"]','high','planning','Unassigned',NULL,'planning',0,'2025-09-21 09:52:29','2025-09-21 09:52:29',NULL),
('INIT-mftiqu15-qo60','BB-001','AI-Driven Customer Interaction Enhancements','Integrate AI and machine learning capabilities into the customer portal to enable personalized customer interactions and predictive service offerings.','Elevates customer engagement and satisfaction through personalized and efficient interactions, driving loyalty and retention.','[\"Implement AI-driven chatbots capable of handling 60% of customer inquiries.\",\"Reduce average response time to customer inquiries from 24 hours to less than 2 hours.\"]','high','planning','Unassigned',NULL,'planning',0,'2025-09-21 09:52:29','2025-09-21 09:52:29',NULL),
('INIT-mftiqu18-zupr','BB-001','User Experience (UX) Optimization for Customer Portal','Enhance the user experience of the customer portal to ensure it is intuitive, accessible, and aligned with customer needs.','Improves customer satisfaction and engagement, leading to higher adoption rates and reduced reliance on traditional customer service channels.','[\"Achieve a 30% improvement in customer satisfaction scores within the first year.\",\"Complete UX redesign with positive user feedback from at least 80% of participants in user testing.\"]','medium','planning','Unassigned',NULL,'planning',0,'2025-09-21 09:52:29','2025-09-21 09:52:29',NULL),
