INSERT INTO `stories` (`id`, `epic_id`, `title`, `description`, `user_story`, `acceptance_criteria`, `priority`, `status`, `assigned_to`, `story_points`, `workflow_stage`, `completion_percentage`, `created_at`, `updated_at`) VALUES ('story-001','epic-001','As a user, I want to log in with my email and password','User authentication via email/password combination.','As a user, I want to log in with my email and password so that I can access my account securely.','[\"Valid email format validation\",\"Password strength requirements\",\"Account lockout after failed attempts\"]','high','backlog',NULL,3,'planning',10,'2025-08-20 09:35:44','2025-08-20 09:35:44'),
('story-001b','epic-001','As a user, I want to reset my password securely','Secure password reset functionality with email verification.','As a user, I want to reset my password securely so that I can regain access to my account.','[\"Email verification required\",\"Secure reset link expiry\",\"Password strength validation\"]','medium','backlog',NULL,3,'planning',10,'2025-08-20 09:35:44','2025-08-20 09:35:44'),
('story-002','epic-002','As a customer, I want to pay with Apple Pay on mobile','Implement Apple Pay integration for mobile commerce','As a customer, I want to pay with Apple Pay on mobile so that I can complete purchases quickly','[\"Apple Pay button visible\",\"Secure payment processing\",\"Receipt generation\"]','medium','backlog',NULL,3,'planning',10,'2025-08-20 09:35:44','2025-08-20 09:35:44'),
('story-002b','epic-002','As a customer, I want to pay with Google Pay on Android','Implement Google Pay integration for Android devices','As a customer, I want to pay with Google Pay on Android so that I can checkout seamlessly','[\"Google Pay integration\",\"Android compatibility\",\"Secure tokenization\"]','medium','backlog',NULL,3,'planning',10,'2025-08-20 09:35:44','2025-08-20 09:35:44'),
('story-003','epic-003','As an inventory manager, I want to see AI-generated demand forecasts','Provide AI-powered demand forecasting interface for inventory management','As an inventory manager, I want to see AI-generated demand forecasts so that I can make informed stocking decisions','[\"Forecast accuracy display\",\"Historical trend analysis\",\"Automated recommendations\"]','high','backlog',NULL,3,'planning',10,'2025-08-20 09:35:44','2025-08-20 09:35:44'),
('story-003b','epic-003','As an inventory manager, I want automated reorder alerts','Automated notifications when inventory reaches reorder points','As an inventory manager, I want automated reorder alerts so that I never run out of critical stock','[\"Real-time stock monitoring\",\"Configurable thresholds\",\"Multiple notification channels\"]','high','backlog',NULL,3,'planning',10,'2025-08-20 09:35:44','2025-08-20 09:35:44'),
('story-004','epic-004','As an Emirates customer, I want to access Manage Bookings from the website','Implement the Manage Bookings navigation and access functionality on Emirates.com','As an Emirates customer, I want to access Manage Bookings from the website so that I can view and modify my flight reservations','[\"Manage Bookings link is visible and accessible on Emirates.com homepage\",\"Clicking Manage Bookings opens the booking management interface\",\"Interface is responsive and works on desktop and mobile browsers\",\"Page loads within 3 seconds on standard internet connections\"]','high','in_progress',NULL,3,'planning',10,'2025-08-20 09:35:44','2025-08-20 09:35:44'),
('story-004b','epic-004','As an Emirates customer, I want to enter my booking reference to find my reservation','Booking reference validation and lookup functionality','As an Emirates customer, I want to enter my booking reference so that I can quickly find my reservation details','[\"Booking reference format validation\",\"Clear error messages for invalid references\",\"Quick lookup under 2 seconds\",\"Display booking details clearly\"]','high','in_progress',NULL,3,'planning',10,'2025-08-20 09:35:44','2025-08-20 09:35:44'),
('story-004c','epic-004','As an Emirates customer, I want to view my complete booking details','Comprehensive booking information display','As an Emirates customer, I want to view my complete booking details so that I can verify all information is correct','[\"Flight details displayed clearly\",\"Passenger information shown\",\"Seat assignments visible\",\"Special services listed\"]','high','in_progress',NULL,3,'planning',10,'2025-08-20 09:35:44','2025-08-20 09:35:44'),
('story-004d','epic-004','As an Emirates customer, I want to modify my booking online','Self-service booking modification capabilities','As an Emirates customer, I want to modify my booking online so that I can make changes without calling customer service','[\"Seat selection changes allowed\",\"Date change options available\",\"Add special services\",\"Instant confirmation provided\"]','high','backlog',NULL,3,'planning',10,'2025-08-20 09:35:44','2025-08-20 09:35:44');
